def filter(userfilter):
    if userfilter.lower() == "a":
        tvormovie = str(input("Please select one: (MOVIE / TV) "))
        if tvormovie.lower() == "movie":
            for i in range(len(type)):
                if type[i].lower() == "movie":
                    filteredlist.append(title[i])
            if len(filteredlist) > 0:
                print("Here are the results based on your search: '" + str(tvormovie).upper() + "'")
                print(filteredlist)
            else:
                print("No results found.")
        elif tvormovie.lower() == "tv":
            for i in range(len(type)):
                if type[i].lower() == "tv show":
                    filteredlist.append(title[i])
            if len(filteredlist) > 0:
                print("Here are the results based on your search: '" + str(tvormovie).upper() + "'")
                print(filteredlist)
            else:
                print("No results found.")
        else:
            print("Invalid input.")

    elif userfilter.lower() == "b":
        usercountry = str(input("Please enter a country: "))
        for i in range(len(country)):
            if usercountry.lower() in country[i].lower():
                filteredlist.append(title[i])
        if len(filteredlist) > 0:
            print("Here are the results based on your search: '" + str(usercountry).upper() + "'")
            print(filteredlist)
        else:
            print("No results found.")
    elif userfilter.lower() == "c":
        useryear = int(input("Please enter a year: "))
        for i in range(len(releaseyear)):
            if useryear == releaseyear[i]:
                filteredlist.append(title[i])
        if len(filteredlist) > 0:
            print("Here are the results based on your search: '" + str(useryear) + "'")
            print(filteredlist)
        else:
            print("No results found.")
    elif userfilter.lower() == "d":
        userrating = str(input("Please enter a TV rating: (TV-G, TV-PG, TV-14, R) "))
        for i in range(len(rating)):
            if userrating.lower() == rating[i].lower():
                filteredlist.append(title[i])
        if len(filteredlist) > 0:
            print("Here are the results based on your search: '" + str(userrating).upper() + "'")
            print(filteredlist)
        else:
            print("No results found.")
    elif userfilter.lower() == "e":
        usergenre = str(input("Please enter a genre: (ex. horror) "))
        for i in range(len(genre)):
            if usergenre.lower() in genre[i].lower():
                filteredlist.append(title[i])
        if len(filteredlist) > 0:
            print("Here are the results based on your search: '" + str(usergenre).upper() + "'")
            print(filteredlist)
        else:
            print("No results found.")
    else:
        print("Invalid input.")

def search(searchtype):
    if searchtype.lower() == "id":
        found_match = 0
        try:
            userid = int(input("Please enter the Netflix ID: "))
            for i in range(len(id)):
                if userid == id[i]:
                    idnum = i
                    found_match += 1
            if found_match >= 1:
                print("!!! MATCH FOUND !!!")
                print(" ")
                print("Title: " + str(title[idnum]))
                print("Type: " + str(type[idnum]))
                print("Country: " + str(country[idnum]))
                print("Date added: " + str(dateadded[idnum]))
                print("Release year: " + str(releaseyear[idnum]))
                print("TV Rating: " + str(rating[idnum]))
                print("Genres: " + str(genre[idnum]))
            else:
                print("No match found. Please make sure you typed in the ID correctly.")
        except:
            print("Error: Input was not number. ")
    elif searchtype.lower() == "title":
        found_match = 0
        usertitle = str(input("Please enter the Netflix title: "))
        for i in range(len(title)):
            if usertitle.lower() == title[i].lower():
                idnum = i
                found_match += 1
        if found_match >= 1:
            print("!!! MATCH FOUND !!!")
            print(" ")
            print("Title: " + str(title[idnum]))
            print("Type: " + str(type[idnum]))
            print("Country: " + str(country[idnum]))
            print("Date added: " + str(dateadded[idnum]))
            print("Release year: " + str(releaseyear[idnum]))
            print("TV Rating: " + str(rating[idnum]))
            print("Genres: " + str(genre[idnum]))
        else:
            print("No match found. Please make sure the title is an exact match.")
    else:
        print("Invalid input.")

